import { Route } from "react-router-dom";

import AllMeetups from "./pages/AllMeetups";
import NewMeetup from "./pages/NewMeetup";
import Favourites from "./pages/Favourites";

function App() {
    return (
      <div>

            <Route path="/">
                <AllMeetups />
            </Route>
            <Route path="/new-meetup">
                <NewMeetup />
            </Route>
            <Route path="/favourites">
                <Favourites />
            </Route>
        </div>
    );
}

export default App;
